import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const DashboardPage: React.FC = () => {
  const [activeTab, setActiveTab] = useState<'listings' | 'testRides'>('listings');
  const [userListings, setUserListings] = useState<any[]>([]);
  const [testRides, setTestRides] = useState<any[]>([]);
  const { user } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch user's listings and test rides from the backend
    const fetchUserData = async () => {
      if (!user) return;

      const token = localStorage.getItem('token');
      if (!token) return;

      try {
        // Fetch user's listings
        const listingsResponse = await fetch(`http://localhost:5000/api/vehicles`, {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });

        if (listingsResponse.ok) {
          const listingsData = await listingsResponse.json();
          // Filter to only show current user's listings
          const userListings = listingsData.filter((listing: any) => 
            listing.dealer?._id === user.id || listing.dealer === user.id
          );
          setUserListings(userListings);
        } else {
          console.error('Failed to fetch listings');
        }

        // Fetch user's test rides (bookings)
        const testRidesResponse = await fetch('http://localhost:5000/api/bookings/my-bookings', {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });

        if (testRidesResponse.ok) {
          const testRidesData = await testRidesResponse.json();
          setTestRides(testRidesData);
        } else {
          console.error('Failed to fetch test rides');
        }
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    };

    fetchUserData();
  }, [user]);

  if (!user) {
    return (
      <div className="min-h-screen bg-gray-50 py-12 px-4 sm:px-6 lg:px-8">
        <div className="max-w-7xl mx-auto">
          <div className="text-center">
            <h2 className="text-3xl font-extrabold text-gray-900">Please log in to view your dashboard</h2>
            <button
              onClick={() => navigate('/login')}
              className="mt-4 bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700"
            >
              Go to Login
            </button>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50 py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <div className="text-center mb-12">
          <h1 className="text-4xl font-extrabold text-gray-900">My Dashboard</h1>
          <p className="mt-2 text-lg text-gray-600">Welcome back, {user?.email || 'User'}</p>
        </div>

        <div className="bg-white shadow overflow-hidden sm:rounded-lg">
          <div className="border-b border-gray-200">
            <nav className="-mb-px flex">
              <button
                className={`py-4 px-6 text-center border-b-2 font-medium text-sm ${activeTab === 'listings' 
                  ? 'border-blue-500 text-blue-600' 
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'}`}
                onClick={() => setActiveTab('listings')}
              >
                My Listings
              </button>
              <button
                className={`py-4 px-6 text-center border-b-2 font-medium text-sm ${activeTab === 'testRides' 
                  ? 'border-blue-500 text-blue-600' 
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'}`}
                onClick={() => setActiveTab('testRides')}
              >
                My Test Rides
              </button>
            </nav>
          </div>

          <div className="p-6">
            {activeTab === 'listings' ? (
              <div>
                <div className="flex justify-between items-center mb-6">
                  <h2 className="text-lg font-medium text-gray-900">My Vehicle Listings</h2>
                  <button
                    onClick={() => navigate('/sell-vehicle')}
                    className="bg-blue-600 text-white px-4 py-2 rounded-md text-sm font-medium hover:bg-blue-700"
                  >
                    + Add New Listing
                  </button>
                </div>

                {userListings.length > 0 ? (
                  <div className="grid grid-cols-1 gap-6 sm:grid-cols-2 lg:grid-cols-3">
                    {userListings.map((listing) => (
                      <div key={listing.id} className="bg-white overflow-hidden shadow rounded-lg">
                        <div className="p-5">
                          <div className="flex items-center">
                            <div className="flex-shrink-0">
                              <img className="h-16 w-16 rounded-md" src={listing.images?.[0] || '/default-vehicle.jpg'} alt={listing.make} />
                            </div>
                            <div className="ml-5 w-0 flex-1">
                              <div className="text-lg font-medium text-gray-900 truncate">
                                {listing.make} {listing.model} ({listing.year})
                              </div>
                              <div className="text-sm text-gray-500">
                                ₹{listing.price?.toLocaleString()}
                              </div>
                            </div>
                          </div>
                          <div className="mt-4 flex justify-end">
                            <button
                              onClick={() => navigate(`/vehicle/${listing.id}`)}
                              className="text-sm font-medium text-blue-600 hover:text-blue-500"
                            >
                              View Details
                            </button>
                          </div>
                        </div>
                      </div>
                    ))}
                  </div>
                ) : (
                  <div className="text-center py-12">
                    <svg
                      className="mx-auto h-12 w-12 text-gray-400"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                      aria-hidden="true"
                    >
                      <path
                        strokeLinecap="round"
                        strokeLinejoin="round"
                        strokeWidth={2}
                        d="M9.172 16.172a4 4 0 015.656 0M9 10h.01M15 10h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z"
                      />
                    </svg>
                    <h3 className="mt-2 text-sm font-medium text-gray-900">No listings</h3>
                    <p className="mt-1 text-sm text-gray-500">Get started by creating a new listing.</p>
                    <div className="mt-6">
                      <button
                        onClick={() => navigate('/sell-vehicle')}
                        className="inline-flex items-center px-4 py-2 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
                      >
                        + New Listing
                      </button>
                    </div>
                  </div>
                )}
              </div>
            ) : (
              <div>
                <h2 className="text-lg font-medium text-gray-900 mb-6">My Test Rides</h2>
                {testRides.length > 0 ? (
                  <div className="overflow-hidden shadow ring-1 ring-black ring-opacity-5 sm:rounded-lg">
                    <table className="min-w-full divide-y divide-gray-300">
                      <thead className="bg-gray-50">
                        <tr>
                          <th scope="col" className="py-3.5 pl-4 pr-3 text-left text-sm font-semibold text-gray-900 sm:pl-6">
                            Vehicle
                          </th>
                          <th scope="col" className="px-3 py-3.5 text-left text-sm font-semibold text-gray-900">
                            Date & Time
                          </th>
                          <th scope="col" className="px-3 py-3.5 text-left text-sm font-semibold text-gray-900">
                            Status
                          </th>
                          <th scope="col" className="relative py-3.5 pl-3 pr-4 sm:pr-6">
                            <span className="sr-only">Actions</span>
                          </th>
                        </tr>
                      </thead>
                      <tbody className="divide-y divide-gray-200 bg-white">
                        {testRides.map((ride) => (
                          <tr key={ride.id}>
                            <td className="whitespace-nowrap py-4 pl-4 pr-3 text-sm font-medium text-gray-900 sm:pl-6">
                              {ride.vehicleMake} {ride.vehicleModel}
                            </td>
                            <td className="whitespace-nowrap px-3 py-4 text-sm text-gray-500">
                              {new Date(ride.scheduledTime).toLocaleString()}
                            </td>
                            <td className="whitespace-nowrap px-3 py-4 text-sm">
                              <span className={`inline-flex rounded-full px-2 text-xs font-semibold leading-5 ${ride.status === 'confirmed' ? 'bg-green-100 text-green-800' : 'bg-yellow-100 text-yellow-800'}`}>
                                {ride.status}
                              </span>
                            </td>
                            <td className="relative whitespace-nowrap py-4 pl-3 pr-4 text-right text-sm font-medium sm:pr-6">
                              <button
                                onClick={() => navigate(`/vehicle/${ride.vehicleId}`)}
                                className="text-blue-600 hover:text-blue-900 mr-4"
                              >
                                View Vehicle
                              </button>
                              <button className="text-red-600 hover:text-red-900">
                                Cancel
                              </button>
                            </td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                ) : (
                  <div className="text-center py-12">
                    <svg
                      className="mx-auto h-12 w-12 text-gray-400"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                      aria-hidden="true"
                    >
                      <path
                        strokeLinecap="round"
                        strokeLinejoin="round"
                        strokeWidth={2}
                        d="M9.172 16.172a4 4 0 015.656 0M9 10h.01M15 10h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z"
                      />
                    </svg>
                    <h3 className="mt-2 text-sm font-medium text-gray-900">No test rides scheduled</h3>
                    <p className="mt-1 text-sm text-gray-500">Browse vehicles to schedule a test ride.</p>
                    <div className="mt-6">
                      <button
                        onClick={() => navigate('/browse')}
                        className="inline-flex items-center px-4 py-2 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
                      >
                        Browse Vehicles
                      </button>
                    </div>
                  </div>
                )}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default DashboardPage;
